import React from "react";
// import Button from "./loginbutton";

function SignupFront() {
  return (
    <div class="logcard2">
      <div class="signup-text">
        <p>SIGN UP</p>
        <p>WITH</p>
        <p>KHANA SHANA</p>
      </div>
      <div class="card2-img">
        <img src="./images/Group 10580.svg" alt="" />
      </div>
    </div>
  );
}

export default SignupFront;
